(39, 6, '<?xml version="1.0"?>\n<documents><rubrique id="1058" idParent="114">Troncon nord<motclef/><article id="1416">Troncon nord<date>2008-04-23 10:37:08</date><maj>2008-04-23 12:06:34</maj><auteur>5</auteur><donnees><grille>62</grille><champs><champ>ligne_1</champ><champ>ligne_3</champ><champ>ligne_2</champ><champ>ligne_4</champ><champ>ligne_5</champ><champ>select_1</champ></champs><donnee><date>2008-04-15 16:42:02</date><maj>2008-04-15 16:42:02</maj><valeur>Troncon nord</valeur><valeur>01</valeur><valeur>Toto</valeur><valeur>26</valeur><valeur>66</valeur><valeur>select_1_5</valeur></donnee></donnees></article><rubrique id="4559" idParent="1058">Escalier sur la voirie 12/05/08 - 17:34:13<motclef>132</motclef><article id="1785">Escalier sur la voirie 12/05/08 - 17:34:13<date>2008-05-12 17:34:13</date><maj>2008-05-12 17:38:30</maj><auteur>6</auteur><donnees><grille>59</grille><champs><champ>ligne_2</champ><champ>ligne_1</champ><champ>mot_1</champ></champs><donnee><date>2008-05-12 17:34:13</date><maj>2008-05-12 17:34:13</maj><valeur>S''il ne comporte aucun mur de chaque c&#xF4;t&#xE9; alors la largeur minimale d''un escalier est de 120 cm</valeur><valeur>cr_voirie_esca_01</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-12 17:34:13</date><maj>2008-05-12 17:34:13</maj><valeur>S''il comporte un mur d''un seul c&#xF4;t&#xE9; alors la largeur minimale d''un escalier est de 130 cm</valeur><valeur>cr_voirie_esca_02</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-12 17:34:13</date><maj>2008-05-12 17:34:13</maj><valeur>S''il est plac&#xE9; entre deux murs alors la largeur minimale d''un escalier est de 140 cm</valeur><valeur>cr_voirie_esca_03</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-12 17:34:13</date><maj>2008-05-12 17:34:13</maj><valeur>La hauteur des marches est inf&#xE9;rieur &#xE0; 16 cm</valeur><valeur>cr_voirie_esca_04</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-12 17:34:13</date><maj>2008-05-12 17:34:13</maj><valeur>La hauteur des marches est la m&#xEA;me pour un escalier</valeur><valeur>cr_voirie_esca_05</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-12 17:34:13</date><maj>2008-05-12 17:34:13</maj><valeur>Le giron est &gt;= &#xE0; 28 cm</valeur><valeur>cr_voirie_esca_06</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-12 17:34:13</date><maj>2008-05-12 17:34:13</maj><valeur>Le nez de la premi&#xE8;re marche est visuellement contrast&#xE9;</valeur><valeur>cr_voirie_esca_07</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-12 17:34:13</date><maj>2008-05-12 17:34:13</maj><valeur>Le nez de la derni&#xE8;re marche est visuellement contrast&#xE9;</valeur><valeur>cr_voirie_esca_08</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-12 17:34:13</date><maj>2008-05-12 17:34:13</maj><valeur>Tout escalier de 3 marches ou plus comporte deux mains courantes ou une main courante centrale </valeur><valeur>cr_voirie_esca_09</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-12 17:34:13</date><maj>2008-05-12 17:34:13</maj><valeur>Si l''escalier &#xE0; une largeur &gt; &#xE0; 420 cm alors il comporte au moins une main courante interm&#xE9;diaire</valeur><valeur>cr_voirie_esca_10</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-12 17:34:14</date><maj>2008-05-12 17:34:14</maj><valeur>La largeur entre les mains courantes est &gt;= &#xE0; 120 cm</valeur><valeur>cr_voirie_esca_11</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-12 17:34:14</date><maj>2008-05-12 17:34:14</maj><valeur>Les mains courantes d&#xE9;passent la premi&#xE8;re marche de chaque vol&#xE9;e d''une largeur au moins &#xE9;gale au giron</valeur><valeur>cr_voirie_esca_12</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-12 17:34:14</date><maj>2008-05-12 17:34:14</maj><valeur>Les mains courantes d&#xE9;passent la derni&#xE8;re marche de chaque vol&#xE9;e d''une largeur au moins &#xE9;gale au giron</valeur><valeur>cr_voirie_esca_13</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-12 17:34:14</date><maj>2008-05-12 17:34:14</maj><valeur>Les mains courantes sont &#xE0; une hauteur comprise entre 80 cm et 100 cm &#xE0; la verticale du nez de marche (sauf si la main courante fait office de garde-corps)</valeur><valeur>cr_voirie_esca_14</valeur><valeur>124</valeur></donnee></donnees></article></rubrique></rubrique></documents>\n', '2008-05-13 11:07:40'),
