champ>mot_16</champ><champ>mot_17</champ><champ>mot_18</champ><champ>mot_19</champ><champ>mot_20</champ><champ>mot_21</champ><champ>mot_22</champ><champ>mot_23</champ><champ>mot_24</champ><champ>mot_25</champ><champ>mot_26</champ><champ>mot_27</champ><champ>mot_4</champ><champ>mot_5</champ><champ>mot_6</champ><champ>mot_7</champ><champ>mot_9</champ><champ>ligne_1</champ></champs><donnee><date>2008-05-20 12:42:30</date><maj>2008-05-20 12:42:30</maj><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur>Bat test</valeur></donnee></donnees></article><rubrique id="4586" idParent="4585">Cabine test<motclef/><article id="1818" idRub="4586">Cabine test<date>2008-05-20 12:42:50</date><maj>2008-05-20 12:42:58</maj><auteur>5</auteur><donnees><grille>65</grille><champs><champ>ligne_2</champ><champ>ligne_3</champ><champ>select_1</champ><champ>ligne_1</champ><champ>select_2</champ></champs><donnee><date>2008-05-20 12:42:50</date><maj>2008-05-20 12:42:50</maj><valeur/><valeur/><valeur/><valeur>Cabine test</valeur><valeur>select_2_1</valeur></donnee></donnees></article><rubrique id="4587" idParent="4586">Cabine ascenseur 20/05/08 - 12:42:51<motclef>125</motclef><article id="1819" idRub="4587">Cabine ascenseur 20/05/08 - 12:42:51<date>2008-05-20 12:42:58</date><maj>2008-05-20 12:42:58</maj><auteur>5</auteur><donnees><grille>59</grille><champs><champ>ligne_2</champ><champ>ligne_1</champ><champ>mot_1</champ></champs><donnee><date>2008-05-20 12:42:58</date><maj>2008-05-20 12:42:58</maj><valeur>Les commandes int&#xE9;rieures sont situ&#xE9;es sur le c&#xF4;t&#xE9; de la cabine ; &#xE0; droite (ouverture centrale) ou du c&#xF4;t&#xE9; de fermeture de la porte (si l''ascenseur est