ur><valeur>cr_voirie_esca_07</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:16:37</date><maj>2008-05-06 10:16:37</maj><valeur>Le nez de la derni&#xE8;re marche est visuellement contrast&#xE9;</valeur><valeur>cr_voirie_esca_08</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:16:37</date><maj>2008-05-06 10:16:37</maj><valeur>Tout escalier de 3 marches ou plus comporte deux mains courantes ou une main courante centrale </valeur><valeur>cr_voirie_esca_09</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:16:37</date><maj>2008-05-06 10:16:37</maj><valeur>Si l''escalier &#xE0; une largeur &gt; &#xE0; 420 cm alors il comporte au moins une main courante interm&#xE9;diaire</valeur><valeur>cr_voirie_esca_10</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:16:37</date><maj>2008-05-06 10:16:37</maj><valeur>La largeur entre les mains courantes est &gt;= &#xE0; 120 cm</valeur><valeur>cr_voirie_esca_11</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:16:37</date><maj>2008-05-06 10:16:37</maj><valeur>Les mains courantes d&#xE9;passent la premi&#xE8;re marche de chaque vol&#xE9;e d''une largeur au moins &#xE9;gale au giron</valeur><valeur>cr_voirie_esca_12</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:16:37</date><maj>2008-05-06 10:16:37</maj><valeur>Les mains courantes d&#xE9;passent la derni&#xE8;re marche de chaque vol&#xE9;e d''une largeur au moins &#xE9;gale au giron</valeur><valeur>cr_voirie_esca_13</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:16:37</date><maj>2008-05-06 10:16:37</maj><valeur>Les mains courantes sont &#xE0; une hauteur comprise entre 80 cm et 100 cm &#xE0; la verticale du nez de marche (sauf si la main courante fait office de garde-corps)</valeur><valeur>cr_voirie_esca_14</valeur><valeur>124</valeur></donnee></donnees></article><article id="1833" idRub="4597">cr_voirie_esca_04 6/05/08 - 10:16:54<date>2008-05-06 10:16:54</date><maj>2008-05-21 1